function dataUriToBlob(dataUri) {
    const [meta, data] = dataUri.split(",");
    const mime = meta.match(/data:(.*?);base64/)[1];
    const bin = atob(data);

    const bytes = new Uint8Array(bin.length);
    for (let i = 0; i < bin.length; i++) {
        bytes[i] = bin.charCodeAt(i);
    }

    return new Blob([bytes], { type: mime });
}


 
async function unzipToBlobUrls(zipBlob) {
    const zip = await JSZip.loadAsync(zipBlob);
    const blobUrls = {};

    for (const [filename, file] of Object.entries(zip.files)) {
        if (file.dir) continue;

        const lower = filename.toLowerCase();
        let mime = "";

        if (lower.endsWith(".js") || lower.endsWith(".mjs")) mime = "text/javascript";
        else if (lower.endsWith(".css")) mime = "text/css";
        else if (lower.endsWith(".html") || lower.endsWith(".htm")) mime = "text/html";
        else if (lower.endsWith(".webp")) mime = "image/webp";
        else if (lower.endsWith(".png")) mime = "image/png";
        else if (lower.endsWith(".jpg") || lower.endsWith(".jpeg")) mime = "image/jpeg";
        else if (lower.endsWith(".svg")) mime = "image/svg+xml";
        else if (lower.endsWith(".json")) mime = "application/json";
        else if (lower.endsWith(".wasm")) mime = "application/wasm";

        const rawBlob = await file.async("blob");
        const finalBlob = mime
            ? rawBlob.slice(0, rawBlob.size, mime)
            : rawBlob;

        blobUrls[filename] = URL.createObjectURL(finalBlob);
		console.log(filename);
    }

    return blobUrls;
}



async function loadZip(input, DATA_COMPRESSED) {
    let zipBlob;

    if (DATA_COMPRESSED) {
        
        zipBlob = base91DecodeToBlob(input);
    } else {
   
        zipBlob = dataUriToBlob(input);
    }

    return unzipToBlobUrls(zipBlob);

var blobUrlss;




loadZip(zipUrl, DATA_COMPRESSED).then(blobUrls => {
    zipUrl = null;
    
  blobUrlss = blobUrls;
window.blobs = blobUrlss;


    
  

    const ORIGINAL_CREATE_ELEMENT = document.createElement;
    const ORIGINAL_SET_ATTRIBUTE = Element.prototype.setAttribute;

    
    document.createElement = function(tagName) {
        const el = ORIGINAL_CREATE_ELEMENT.call(this, tagName);

        if (tagName.toLowerCase() === 'script') {
            Object.defineProperty(el, 'src', {
                set(newSrc) {
                    const path = extractPath(newSrc);
                    const replacement = rewriteURL(path)
                    if (replacement) {
                        
                        ORIGINAL_SET_ATTRIBUTE.call(el, 'src', replacement);
                    } else {
                        ORIGINAL_SET_ATTRIBUTE.call(el, 'src', newSrc);
                    }
                },
                get() {
                    return el.getAttribute('src');
                },
                configurable: true
            });
        }
		
		 if (tagName.toLowerCase() === "iframe") {
    Object.defineProperty(el, "src", {
      set(value) {
        this.setAttribute("src", rewriteURL(value));
      },
      get() {
        return this.getAttribute("src");
      }
    });}

        return el;
    };

    
   

 
const rewriteRules = {
    SCRIPT: ["src"],
    LINK: ["href"],
    IMG: ["src", "srcset"],
    SOURCE: ["src", "srcset"],
    IFRAME: ["src"],
    AUDIO: ["src"],
    VIDEO: ["src"],
    TRACK: ["src"]
};

Element.prototype.setAttribute = function (name, value) {
    try {
        const tag = this.tagName;
        const attrs = rewriteRules[tag];

        if (attrs && attrs.includes(name) && typeof value === "string") {
            const path = extractPath(value);
            const replacement = rewriteURL(path);

            if (replacement) {
                return ORIGINAL_SET_ATTRIBUTE.call(this, name, replacement);
            }
        }
    } catch (err) {
        console.warn("set attribute fail:", err);
    }

    return ORIGINAL_SET_ATTRIBUTE.call(this, name, value);
};

    
    
    
    

    function extractPath(url) {
        return url;
    }


const imageSrcDescriptor = Object.getOwnPropertyDescriptor(Image.prototype, 'src');
Object.defineProperty(Image.prototype, 'src', {
  set(value) {
    const newURL = rewriteURL(value);
    imageSrcDescriptor.set.call(this, newURL);
  },
  get: imageSrcDescriptor.get,
  configurable: true,
  enumerable: true,
});

 

const linkHrefDescriptor = Object.getOwnPropertyDescriptor(HTMLLinkElement.prototype, 'href');
Object.defineProperty(HTMLLinkElement.prototype, 'href', {
  set(value) {
    const newURL = rewriteURL(value);
    linkHrefDescriptor.set.call(this, newURL);
  },
  get: linkHrefDescriptor.get,
  configurable: true,
  enumerable: true,
});


const mediaSrcDescriptor = Object.getOwnPropertyDescriptor(HTMLMediaElement.prototype, 'src');
Object.defineProperty(HTMLMediaElement.prototype, 'src', {
  set(value) {
    const newURL = rewriteURL(value);
    mediaSrcDescriptor.set.call(this, newURL);
  },
  get: mediaSrcDescriptor.get,
  configurable: true,
  enumerable: true,
});

// fetch
const originalFetch = window.fetch;
window.fetch = function(resource, init) {

  if (typeof resource === "string") {
  //console.log(resource)
    resource = rewriteURL(resource);
  } else if (resource instanceof Request) {
    resource = new Request(rewriteURL(resource.url), resource);
  }
  return originalFetch.call(this, resource, init);
};

// XMLHttpRequest
const originalOpen = XMLHttpRequest.prototype.open;
XMLHttpRequest.prototype.open = function(method, url, ...rest) {
  const newURL = rewriteURL(url);
  return originalOpen.call(this, method, newURL, ...rest);
};


const OriginalAudio = window.Audio;
window.Audio = function(src) {
  const audio = new OriginalAudio();
  if (src) {
    audio.src = rewriteURL(src);
  }
  return audio;
};
window.Audio.prototype = OriginalAudio.prototype;

	const OriginalFontFace = window.FontFace;

window.FontFace = function (family, source, descriptors) {
   
  if (typeof source === "string") {
    source = source.replace(
      /url\((['"]?)(.*?)\1\)/g,
      (match, quote, url) => {
 
        const rewritten = rewriteURL(url);
		 
        return `url(${quote}${rewritten}${quote})`;
      }
    );
  }

   
  return new OriginalFontFace(family, source, descriptors);
};

 
window.FontFace.prototype = OriginalFontFace.prototype;
Object.setPrototypeOf(window.FontFace, OriginalFontFace);


function rewriteURL(original) {

  if (original.startsWith("blob:") || original.startsWith("data:")) return original;
  
  if (original.includes("apis.google.com/js/client.js") || original.includes("pagead2.googlesyndication.com") || original.includes("gameshtml5.xyz")) return "c";
  
  let trimmed =  original.split("/").pop(); 
  let trimmed2 = original.split('?')[0];
  
  
  if (trimmed.includes("?")) trimmed = trimmed.split("?")[0]

 
  const match = trimmed2.match(/(heeellooo)\/.*/);
  if (match) trimmed2 = match[0];

  return blobUrlss[trimmed2] || blobUrlss[trimmed] || original;
}

 
function load(src, module = false) {
  return new Promise((resolve, reject) => {
    const s = document.createElement("script");
    s.src = src;
    if (module) s.type = "module";
    s.onload = resolve;
    s.onerror = reject;
    document.body.appendChild(s);
  });
}
